import React, { useState } from 'react';
import axios from 'axios';

function DataEntryForm() {
    const [ime, setIme] = useState('');
    const [prezime, setPrezime] = useState('');
    const [adresa, setAdresa] = useState('');
    const [datum_Rodjenja, setDatumRodjenja] = useState('');
    const [kontakt, setKontakt] = useState('');
    const [korisnickoIme, setKorisnickoIme] = useState('');
    const [lozinka, setLozinka] = useState('');
    const [message, setMessage] = useState('');

    const handleSubmit = (event) => {
        event.preventDefault();
        const userData = {
            ime,
            prezime,
            adresa,
            datum_Rodjenja, // Ensure the date format is 'YYYY-MM-DD' if that is what your backend expects
            kontakt,
            korisnicko_ime: korisnickoIme,
            lozinka
        };

        axios.post('http://localhost:3000/unos-lovca', userData)
            .then(response => {
                setMessage(`Response: ${response.data.message}`);
            })
            .catch(error => {
                console.error('There was an error!', error);
                setMessage(`Error: ${error.message}`);
            });
    };

    return (
        <div>
            <h1>Unos lovaca</h1>
            <form onSubmit={handleSubmit}>
                <div>
                    <label>Ime:</label>
                    <input
                        type="text"
                        value={ime}
                        onChange={(e) => setIme(e.target.value)}
                        required
                    />
                </div>
                <div>
                    <label>Prezime:</label>
                    <input
                        type="text"
                        value={prezime}
                        onChange={(e) => setPrezime(e.target.value)}
                        required
                    />
                </div>
                <div>
                    <label>Adresa:</label>
                    <input
                        type="text"
                        value={adresa}
                        onChange={(e) => setAdresa(e.target.value)}
                        required
                    />
                </div>
                <div>
                    <label>Datum rođenja:</label>
                    <input
                        type="text"
                        value={datumRodjenja}
                        onChange={(e) => setDatumRodjenja(e.target.value)}
                        required
                    />
                </div>
                <div>
                    <label>Kontakt:</label>
                    <input
                        type="text"
                        value={kontakt}
                        onChange={(e) => setKontakt(e.target.value)}
                        required
                    />
                </div>
                <div>
                    <label>Korisničko ime:</label>
                    <input
                        type="text"
                        value={korisnickoIme}
                        onChange={(e) => setKorisnickoIme(e.target.value)}
                        required
                    />
                </div>
                <div>
                    <label>Lozinka:</label>
                    <input
                        type="password"
                        value={lozinka}
                        onChange={(e) => setLozinka(e.target.value)}
                        required
                    />
                </div>
                <button type="submit">Submit</button>
            </form>
            {message && <p>{message}</p>}
        </div>
    );
}

export default DataEntryForm;
